import "./App.css";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" exact element={<Login />} />
        <Route path="/ChatList" exact element={<ChatList />} />
        <Route path="/Chat/:sendTo" exact element={<Chat />} />
      </Routes>
    </>
  );
}

export default App;
